import java.io.BufferedReader;import java.io.IOException;import java.io.InputStreamReader;import java.util.ArrayList;import java.util.Collections;import java.util.Scanner;public class exam4_10 {    public static void main(String[] args) throws IOException {        BufferedReader bf = new BufferedReader(new InputStreamReader(System.in));        String s = bf.readLine();        String[] str = s.split(" ");        int m = Integer.parseInt(str[0]);        StringBuffer sss = new StringBuffer();        for (int i = 1; i < str.length; i++) {            sss.append(str[i] + "");        }        String ss = sss.toString();        ArrayList list = new ArrayList<>();        int n = Integer.parseInt(bf.readLine());        int sum = 0, avg = 0;        int[] nums = new int[n];        String[] attr = new String[n];        for (int i = 0; i < n; i++) {            String[] line = bf.readLine().split(" ");            attr[i] = line[0];            nums[i] = Integer.parseInt(line[1]);            sum += nums[i];        }        avg = sum / n;        for (int i = 0; i < n; i++) {            if (!ss.contains(attr[i]) && nums[i] > avg) {                list.add(attr[i]);            }        }        Collections.sort(list);        if (list.size() > 0) {            for (int i = 0; i < list.size(); i++) {                System.out.println(list.get(i));            }        } else {            System.out.println("Bing Mei You");        }    }}